css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #ffffff;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #ffca28;
}
.header-view .icon-check {
  color: #8bc34a;
}
.header-view .icon-hourglass {
  color: rgba(56, 58, 66, 0.8);
}
.header-view .icon-stop {
  color: #f44336;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #fafafa;
  color: rgba(56, 58, 66, 0.8);
}
.script-view .stderr {
  color: #f44336;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
